import { Link } from "react-router-dom";
import { Home } from "../pages/home";
export default function Navbar() 
{
    return ( 
        <nav className="navbar">
            <a href="/" className="logo">DEMO</a>
            <ul>
                <li className="active">
                    <Link  to='/'> Home</Link>
                </li>
                <li>
                    <a href="#">services</a>
                </li>
                <li>
                    <a href="#">Contact us</a>
                </li>
                <li>
                    <a href="#">Login/sign up!</a>
                </li>

            </ul>
        </nav>
    );
}
